import Link from 'next/link';

import {MenuLinkStyles} from './MenuLinkStyles';

export default function MenuLink({product}) {
  return (
    <MenuLinkStyles>
      <a href="#"><p>{[roduct.title]}</p></a>
    </MenuLinkStyles>
  )
}
